/* Function  structure for function  `getPinyin` */

/*!50003 DROP FUNCTION IF EXISTS `getPinyin` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getPinyin`(v_words VARCHAR(255),v_type INT) RETURNS varchar(255) CHARSET utf8
BEGIN
 	DECLARE v_result VARCHAR(255);
	DECLARE v_temp VARCHAR(30);
	DECLARE v_length INT;
	DECLARE v_count INT;
	DECLARE v_word VARCHAR(30);
	DECLARE v_i INT;
	
	SET v_temp =REPLACE(v_words,' ','');
	SET v_length = LENGTH(v_temp);
	SET @v_result = '';
	WHILE v_length>0 DO
	
		SET v_word = SUBSTRING(v_temp,1,1);
		SELECT COUNT(1) INTO v_count FROM t_sys_gb18030 WHERE hanzi = v_word LIMIT 0,1;
		IF v_count>0  THEN
			 SELECT COUNT(1) INTO v_count FROM t_sys_gb2312 WHERE hanzi=v_Word;
			 IF v_count>0 THEN 
				IF v_type=1 THEN
					SELECT CONCAT(@v_result,FIRST) INTO @v_result FROM t_sys_gb2312 WHERE hanzi=v_word LIMIT 0,1;
				END IF;
				IF v_type=2 THEN
				       SELECT  CONCAT(@v_result,SUBSTRING(FIRST,1,1)) INTO @v_result FROM t_sys_gb2312 WHERE hanzi=v_word LIMIT 0,1;
				END IF;
				
				SET v_temp = SUBSTRING(v_temp,2,LENGTH(v_temp)-1);
				SET v_length = LENGTH(v_temp);
			ELSE 
				SELECT  CONCAT(@v_result,pinyin) INTO @v_result FROM t_sys_gb18030 WHERE hanzi=v_word LIMIT 0,1;
				SET v_temp = SUBSTRING(v_temp,2,LENGTH(v_temp)-1);
				SET v_length = LENGTH(v_temp);
			END IF;
		ELSE 
		        
			SELECT  CONCAT(@v_result,v_word) INTO @v_result;     
			SET v_temp = SUBSTRING(v_temp,2,LENGTH(v_temp)-1);
			SET v_length = LENGTH(v_temp);
		END IF;
	END WHILE;
	
	RETURN (@v_result);
    END */$$
DELIMITER ;

/* Function  structure for function  `RelationTableName` */

/*!50003 DROP FUNCTION IF EXISTS `RelationTableName` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `RelationTableName`(
	MC varchar(50)
    ) RETURNS varchar(50) CHARSET utf8
BEGIN
	DECLARE ZS varchar(50);
	
	SELECT BZS into ZS from t_base_table where BMC = MC;
	
	return ZS;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `RelationTable` */

/*!50003 DROP PROCEDURE IF EXISTS  `RelationTable` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `RelationTable`(
	in BMC varchar(50)
    )
BEGIN
	SELECT BMC ZBMC,BMC WBMC,BMC,RelationTableName(BMC) BZS,0 type,NULL ZBZD,NULL WBZD from dual
	union
	SELECT ZBMC,WBMC,WBMC BMC,RelationTableName(WBMC) BZS,1 type,ZBZD,WBZD from t_base_foreignkey where ZBMC = BMC
	union
	SELECT ZBMC,WBMC,ZBMC BMC,RelationTableName(ZBMC) BZS,2 type,ZBZD,WBZD from t_base_foreignkey where WBMC = BMC;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `RelationTableOfwb` */

/*!50003 DROP PROCEDURE IF EXISTS  `RelationTableOfwb` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `RelationTableOfwb`(
	in BMC varchar(50),
	IN WB VARCHAR(50)
    )
BEGIN
	SELECT ZBMC,WBMC,WBMC BMC,RelationTableName(WBMC) BZS,2 type,ZBZD,WBZD from t_base_foreignkey where ZBMC = BMC AND WBMC != WB;
	
    END */$$
DELIMITER ;

